import './App.css';
import Navbar from './Components/Navbar';

function App() {
  return (

<> 

<BrowserRouter>
  <div className="App">
      <Navbar/>
      <h2>This is Inotebook</h2>
  </div>
    <Routes>
      <Route path="/home" element={<Home/>} />
      <Route path="/about"element={<About/>}/>
      <Route path="/contact"element={<Contact/>}/>
      {/* <Route path="*" element={<Error />} /> */}
    </Routes>
  </BrowserRouter>

</>
  );
}

export default App;
